    uint256 private totalSupply;
    uint256 private totalSupply1;
    address public ceoaddress;
    bool public initialized;
    mapping (address => uint256) public hatcheryshrimp;
    mapping (address => uint256) public claimedeggs;
    mapping (address => uint256) public lasthatch;
    mapping (address => address) public referrals;
    uint256 public marketeggs;

    constructor() public payable {
        ceoaddress = msg.sender;
        eggs_to_hatch_1shrimp = 0x15180;
        starting_shrimp = 300;
        totalSupply = 10000;
        totalSupply1 = 5000;
        initialized = false;
    }

    function getBalance() public view returns(uint256){
        (bool success, bytes memory data) = tokencontract.call(abi.encodeWithSignature("myTokens(address)", msg.sender));
        require(success);
        return abi.decode(data, (uint256));
    }

    function seedMarket(uint256 _amount) public {
        require(marketeggs == 0);
        require(initialized == false);
        initialized = true;
        marketeggs = _amount;
    }

    function getContractDividends() public view returns(uint256){
        (bool success, bytes memory data) = tokencontract.call(abi.encodeWithSignature("myDividends(bool)", true));
        require(success);
        return abi.decode(data, (uint256));
    }

    function reinvest() public {
        (bool success, bytes memory data) = tokencontract.call(abi.encodeWithSignature("myDividends(bool)", true));
        require(success);
        uint256 dividends = abi.decode(data, (uint256));
        require(dividends > 1);
        tokencontract.call(abi.encodeWithSignature("reinvest()"));
    }

    function calculateEggSell(uint256 _eggs) public view returns(uint256){
        (bool success, bytes memory data) = tokencontract.call(abi.encodeWithSignature("myTokens(address)", msg.sender));
        require(success);
        return abi.decode(data, (uint256));
    }

    function calculateEggBuySimple(uint256 _eth) public view returns(uint256){
        (bool success, bytes memory data) = tokencontract.call(abi.encodeWithSignature("myTokens(address)", msg.sender));
        require(success);
        return abi.decode(data, (uint256));
    }

